INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, 'Με αφορμή τις επικείμενες αλλαγές στο Facebook, πολλά μέλη του κοινωνικού δικτύου αναρτούν στην σελίδα τους μια δήλωση περί διατήρησης της κυριότητας του περιεχομένου που ανεβάζουν. Η ανάρτηση αυτή διαδίδεται από φίλο σε φίλο και έτσι, δεν είναι διόλου απίθανο να είδατε το χρονολόγιό σας να πλημμυρίζει με δηλώσεις του τύπου I hereby declare...\r\n\r\nΣυγκεκριμένα, η ανάρτηση στην αγγλική γλώσσα (αλλά και πολλές αποδόσεις στα ελληνικά) γράφει:\r\n\r\n"In response to the new Facebook guidelines, I hereby declare that my copyright is attached to all of my personal details, illustrations, comics, paintings, crafts, professional photos and videos, etc. (as a result of the Berner Convention).\r\nFor commercial use of the above my written consent is needed at all times!\r\nFacebook is now an open capital entity. All members are recommended to publish a notice like this, or if you prefer, you may copy and paste this version."\r\n\r\nΜε λίγα λόγια, με αυτή τη δήλωση το μέλος του Facebook που την αναρτά επιχειρεί να διασφαλίσει την κυριότητα σε ό,τι ανεβάζει στο προφίλ του και απαιτεί να του ζητείται η έγκριση όποτε οτιδήποτε χρησιμοποιείται για εμπορικούς σκοπούς. Τέλος, προτρέπονται άλλα μέλη να κάνουν το ίδιο ή κάτι ανάλογο, αντιγράφοντας την δήλωση αυτή στο προφίλ τους, με το επιχείρημα ότι το Facebook είναι εταιρεία εισηγμένη στο χρηματιστήριο.\r\n\r\nΩστόσο, όπως διαπιστώνει ο γνωστός δημοσιογράφος Ντέιβιντ Πογκ στην εφημερίδα Τάιμς της Νέας Υόρκης, και όχι μόνο, πρόκειται για ένα από τα λεγόμενα hoax. Μπορείτε να διαβάσετε σχετικά στο tech.in.gr:\r\n\r\nΙστορίες τρόμου ή τι εστί hoax\r\nΕπιπλέον, η δήλωση περιέχει κάποια προφανή λάθη, όπως συμβαίνει συχνά σε αυτές τις περιπτώσεις (π.χ. γίνεται αναφορά στην ανύπαρκτη Συνθήκη Berner, στην θέση της οποίας μάλλον ο συντάκτης εννοούσε την Συνθήκη της Βέρνης του 1886 που αφορούσε σε λογοτεχνικά και εικαστικά έργα).\r\n\r\nΕκτός όμως από αυτά τα αντεπιχειρήματα, το Facebook έχει δημόσια διαψεύσει την φήμη:\r\n\r\nΣτην σελίδα Facebook and Privacy στο Facebook υπάρχει επίσημη διάψευση που αναφέρει πως:\r\n«Κυκλοφορεί μια φήμη ότι το Facebook κάνει μια αλλαγή που συνδέεται με την κυριότητα των πληροφοριών των χρηστών ή το περιεχόμενο που δημιοσιεύουν σε αυτόν. Είναι ψευδής. Οποιοσδήποτε χρησιμοποιεί το Facebook κατέχει και ελέγχει το περιεχόμενο και την πληροφορία που αναρτά, όπως περιγράφεται στους όρους της υπηρεσίας. Κάντε κλικ εδώ για να μάθετε περισσότερα - www.facebook.com/policies.»\r\nΤέλος, τα δικαιώματά σας στο Facebook αναφέρονται με λεπτομέρεια στην σελίδα https://www.facebook.com/legal/terms?ref=pf  Εκεί διευκρινίζεται πως: \r\n\r\n«Το σύνολο του περιεχομένου και των πληροφοριών που δημοσιεύετε στο Facebook σάς ανήκει και μπορείτε να ελέγχετε τον τρόπο με τον οποίο κοινοποιείται σε τρίτους μέσω των ρυθμίσεων απορρήτου και εφαρμογών».', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, 'Η Ευρωπαϊκή Κεντρική Τράπεζα πρότεινε ο πανίσχυρος Ευρωπαίος Επίτροπος, αρμόδιος για την αντιμονοπωλιακή πολιτική, να πάρει ένα νέο ρόλο που θα αφορά στο οριστικό κλείσιμο των αδύναμων τραπεζών που επιβιώνουν από τους πόρους που τους παρέχει η Κεντρική Τράπεζα.\r\nΌπως μεταδίδει το Reuters, ελλείψει πανευρωπαϊκού σχεδίου για τα πιστωτικά ιδρύματα, ο ρόλος της εκκαθάρισης των αποκαλούμενων τραπεζών-ζόμπι πέφτει στη δικαιοδοσία του Αλμούνια, του Ευρωπαίου Επίτροπου, αρμόδιου για την αντιμονοπωλιακή πολιτική, ο οποία ενέκρινε σήμερα την αναδιοργάνωση του ισπανικού τραπεζικού τομέα και επιθυμεί να γίνουν αντίστοιχα βήματα και στις ελληνικές τράπεζες.\r\nΑξιωματούχοι της ΕΚΤ εξετάζουν το αν θα μπορούσε να δοθεί στον Αλμούνια η δικαιοδοσία σε μόνιμη βάση και θα αφορά τις τράπεζες που είναι πολύ αδύναμες για να επιβιώσουν.\r\nΗ ίδρυση μία σχετικής υπηρεσίας θα είναι προς την κατεύθυνση της τραπεζικής ενοποίησης και θα αφορά τράπεζες που κρατούνται ζωντανές «με μηχανική υποστήριξη», με στόχο φυσικά να αποκατασταθεί η εμπιστοσύνη στον ευρωπαϊκό τραπεζικό τομέα.', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Δήλωση, η οποία δεν θα ηχήσει καλά στα αυτιά του κόσμου του Παναθηναϊκού έκανε ο επί σειρά ετών παράγοντας του «τριφυλλιού», Μάνος Μαυροκουκουλάκης. \r\n\r\n«Δεν υπήρξε καμία παράγκα. Δεν θέλω να απαντήσω. Εγώ τα του οίκου μου κρίνω», είπε στον NovaΣΠΟΡ FM 94,6 σε ερώτηση του Τάσου Νικολογιάννη. \r\n\r\n«Ο Βαρδινογιάννης δεν ασχολήθηκε ποτέ με την διαιτησία», συμπλήρωσε ο Mr Manos, ενώ επιτέθηκε με βαριές εκφράσεις στο μέλος της Παναθηναϊκής Συμμαχίας, Δ. Βερβεσό. \r\n\r\nΟ κ. Μαυροκουκουλάκης βγήκε στον αέρα της πρώτης αθλητικής συχνότητας της χώρας για να απαντήσει σε δηλώσεις του μέλους της Παναθηναϊκής Συμμαχίας, κ. Βερβεσού. Ο τελευταίος είπε πως υπάρχει παράγκα στο ποδόσφαιρο και πως δεν είναι κάτι περίεργο, αφού και παλιότερα, επί εποχής Βαρδινογιάννη υπήρχε. Ο παλιός παράγοντας του «τριφυλλιού» θίχτηκε και βγήκε στους Αντώνη Καρπετόπουλο και Αντώνη Πανούτσο να δώσει απαντήσεις. \r\n\r\nΔιαβάστε όσα είπε στον NovaΣΠΟΡ FM 94,6 ο Μάνος Μαυροκουκουλάκης: \r\n\r\n«Σας παρακαλώ, μην υποβαθμίζετε αυτά που δήλωσε ο Βερβεσός. Δεν χρειάζεται να το κάνουμε… πασαληψατέρ. Είναι διακεκριμένος δικηγόρος. Προσεκτικά να μιλήσουμε λοιπόν. Σε ότι αφορά εμένα, εγώ υπηρέτησα τον σύλλογο για 20-22 χρόνια. Ως αντιπρόεδρος και ως διευθύνων σύμβουλος. Μετά τον επαγγελματικό αθλητισμό του 79’, να ξέρετε, πως ο κύριος Βαρδής Βαρδινογιάννης στα εβδομαδιαία μίτινγκ που κάναμε, όταν εμείς φοβόμασταν την διαιτησία, μας απαντούσε επί λέξει: “Να κάνετε την καλύτερη ομάδα παιδιά. Να βάζετε 4 και να σας ακυρώνουν τα 2”. Δεν αλλάζω ούτε λέξη. Πάντα έλεγα το ίδιο. Όσιμ, Ρότσα, Γαλάκος, Ζάετς, Δανιήλ. \r\n\r\nΑπό εκεί και πέρα, στην ολιγόμηνη περίοδο που συνεργάστηκα με τον Βγενόπουλο, και όταν τον πίεζα να πάρει το πλειοψηφικό πακέτο, μου έλεγε. “Μάνο, εγώ στο πρωτάθλημα, τι προστασία θα έχω για το ευ αγωνίζεσθαι. Εγώ αυτά ξέρω. Οπότε, λοιπον, ο Βερβεσος που βγήκε και είπε αυτά τα πράγματα χτες για την εποχή Βαρδινογιάννη, μπορεί να πάει στο διάολο και ακόμη παραπέρα. Και να μάθει να διοικεί κι ας μην ξέρει να δένει τα παπούτσια του. Δεν επιτρέπεται να μιλάει για νεκρούς και να σπιλώνει μνήμες χωρίς να ξέρει». \r\n\r\n-Πανούτσος: Ας πούμε ότι ο Κόκκαλης έχει επηρεάσει διαιτητές… Πως υπάρχει μια υπόνοια. \r\n\r\n-Μαυροκουκουλάκης: «Εγώ δεν θα πω αυτό». \r\n\r\n-Πανούτσος: «Υπάρχει κάποιος που έχει αντίρρηση πως ο Κόκκαλης έχει ασχοληθεί με την διαιτησία; \r\n\r\n-Μαυροκουκουλάκης: «Δεν θα απαντήσω. Εγώ μιλάω για προσωπικό επίπεδο» \r\n\r\n-Νικολογιάννης: Κύριε Μαυροκουκουλάκη, να κάνω κι εγώ μια ερώτηση μιας και είστε παράγοντας που υπηρέτησε τον Παναθηναϊκό. Δέχεστε πως από το 1996 και μετά υπήρχε παράγκα στο ελληνικό ποδόσφαιρο που βοήθησε τον Ολυμπιακό να παίρνει πρωταθλήματα; \r\n\r\n-Μαυροκουκουλάκης: «Εγώ δεν δέχομαι καμία παράγκα» \r\n\r\n-Νικολογιάννης: «Ε μα δεν είναι δυνατόν αυτό το πράγμα». \r\n\r\n-Καρπετόπουλος: «Κάτσε ρε Τάσο, ότι θέλεις εσύ θα πει ο άνθρωπος ή ότι θέλει αυτός. Ας πει ότι την δέχεται την παράγκα να μεινουμε όλοι ευχαριστημένοι»; \r\n\r\n-Μαυροκουκουλάκης: «Εγώ δεν είμαι επιπέδου παράγκας». \r\n\r\n-Νικολογιάννης: «Ευννοια για τον Ολυμπιακό δεν υπήρξε κύριε Μαυροκουκουλάκη»; \r\n\r\n-Μαυροκουκουλάκης: «Δεν με ενδιαφέρει αν υπήρξε. Δεν απαντάω. Στον κύριο Πανούτσο περνάει η ραδιοφωνική μαγκιά κύριε Νικολογιάννη; Δεν περνάει γιατί ξέρει πώς να φερθεί. Δεν θέλω να απαντήσω με ένα ναι ή με ένα όχι. Εγώ τα του οίκου μου κρίνω», είπε το παλιό στέλεχος της διοίκησης του Παναθηναϊκού, αφήνοντας ερωτηματικά αναφορικά με την άποψη του, αφού υπάρχει διάχυτη η πεποίθηση πως η «Παράγκα του Θωμά» υπήρξε… \r\n\r\n-Νικολογιάννης: «Εγώ ξέρω μάρτυρες όμως, που εσείς αναφέρατε προηγουμένως, όπως ο κύριος Δανιήλ, που έλεγε πως με την παράγκα δεν πρόκειται να πάμε μπροστά και να προχωρήσουμε και στις συζητήσεις αυτές, σαν διοικητικό στέλεχος ήσασταν παρών»... \r\n\r\n-Μαυροκουκουλάκης: «Οχι, όχι, δεν ισχύει. Πιο σιγά. Αυτό είναι υπερβολή». \r\n\r\nΑλέξης Παπαχρήστος', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Κατηγορηματικός ότι η διοίκηση του ΟΑΚΑ θα διεκδικήσει από τον Παναθηναϊκό τα χρήματα που οφείλει για την χρήση του γηπέδου εμφανίστηκε ο Πέτρος Γαλακτόπουλος. \r\n\r\n«Οι μεγάλες ομάδες δεν πληρώνουν. Δεν μπορούμε να τους αφήσουμε έτσι. Δεν κυνηγάμε τον ΠΑΟ, αλλά πρέπει να έρθουμε σε διακανονισμό για τα χρήματα που οφείλει», τόνισε ο νέος πρόεδρος του ΟΑΚΑ στον NovaΣΠΟΡ FM 94,6. \r\n\r\nΤη λειτουργία μουσείου Ελλήνων Ολυμπιονικών «Σπύρος Λούης» στο Ολυμπιακό Στάδιο προανήγγειλε ο παλιός πρωταθλητής της πάλης. \r\n\r\nΑναλυτικά, όσα είπε στην εκπομπή «Μπαμ και Κάτω», με τους Μπάμπη Χριστόγλου και Μιχάλη Λεάνη: \r\n\r\nΗ συζήτηση έγινε με αφορμή την επιστολή της διοίκησης του ΟΑΚΑ οι αγώνες του Παναθηναϊκού να γίνονται το μεσημέρι λόγω ανεξόφλητων οφειλών στη ΔΕΗ: «Σήμερα δεν κυνηγάμε τον Παναθηναϊκό, αλλά χρωστάει λεφτά, ένα ποσό από πέρυσι και πρέπει να έρθουμε σε διακανονισμό. Αύριο θα έχουμε ραντεβού με την ΑΕΚ, η οποία χρωστάει πολύ λιγότερα λεφτά. Δεν χαρίζουμε λεφτά. Ανήκουμε στο υπουργείο Οικονομικών και στην γενική γραμματεία Αθλητισμού. Θα κυνηγήσουμε την ΠΑΕ, την ποδηλατοδρομία, τον ΣΕΓΑΣ και όποιον άλλο μας χρωστάει. Το ίδιο κάνει και στο ΟΑΚΑ και σε άλλους προμηθευτές. Ο ένας χρωστάει στον άλλο. Το προσωπικό παίρνει τα λεφτά του, οι ενοικιαστές κάποιοι πληρώνουν κι άλλοι όχι. \r\n\r\nΟι μεγάλες ομάδες δεν πληρώνουν το ΟΑΚΑ. Δεν μπορούμε να τους αφήσουμε έτσι, με τον νέο νόμο, για να μην νομίζουν ότι θα τους χαρίσουμε λεφτά. Ή θα δώσει τη λύση η Πολιτεία ή θα κάνουμε κατασχέσεις. Ισχύει βεβαίως το ουκ αν λάβεις παρά του μη έχοντος. Όμως η διαδικασία είναι επιβεβλημένη. Δεν μπορούμε να αντιταχθούμε στον νέο νόμο». \r\n\r\nΓια τη δυσκολία του Παναθηναϊκού να φανεί συνεπής: «Δεν είναι μόνο ο αθλητισμός, είναι και ένα μεγάλο μέρος της κοινωνίας έτσι. Πήραμε λεφτά από τις τράπεζες, δεν μπορούμε να τα δώσουμε. Έτσι συμβαίνει και στον Παναθηναϊκό. Όταν χρωστάμε εμείς 5,5 εκατ. στη ΔΕΗ από πού τα χρωστάμε; Από ό,τι είναι να λαμβάνουμε…». \r\n\r\nΓια το πώς σκέφτεται να αξιοποιήσει τις εγκαταστάσεις του ΟΑΚΑ: «Εδώ ο χώρος θα ανοίξει τις πόρτες του στον κόσμο. Σε κανένα άλλο μέρος του κόσμου, στην Ευρώπη, σε χώρα που έχει φιλοξενήσει τους Ολυμπιακούς Αγώνες, το στάδιο δεν είναι χώρος επίσκεψης, πόλος έλξης. Θέλουμε να είναι χώρος επίσκεψης, ενώ θα κάνουμε πάλι το μουσείο των Ελλήνων Ολυμπιονικών “Σπύρος Λούης”. Την ιστορία των Ολυμπιακών Αγώνων. Όποιος ξεχνάει το παρελθόν, δεν έχει μέλλον. Τον αθλητισμό τον έχουν εγκαταλείψει. Ο αθλητισμός είναι πολιτισμός. Δεν πρέπει να ξεχνιούνται οι αθλητές μας».', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'Την διοργάνωση του Πανευρωπαϊκού Πρωταθλήματος στην ιστιοπλοΐα σκαφών 470 για το 2013 ανέλαβε ο Ναυτικός Όμιλος Τζιτζιφιών Καλλιθέας, όπως ενημέρωσε ο Παντελής Παυλίδης μέσω του NovaΣΠΟΡ FM 94,6. «Πρέπει να στηριχθούμε στον αθλητικό τουρισμό, επειδή κάποιοι βασίστηκαν σε αυτό μόνο για είκοσι μέρες το 2004. Αφού υστερούμε σε βιομηχανίες χρειάζεται να στηρίξουμε την τουριστική βιομηχανία», τόνισε ο πρόεδρος του ομίλου. \r\n\r\nΑναλυτικά όσα δήλωσε ο Παντελής Παυλίδης στην εκπομπή «Πνίξτε τον φουνταριστό» με τους Γιώργος Θαναηλάκη και Μηνά Τσαμόπουλο \r\n\r\n«Θα έρθουν ομάδες από όλες τις χώρες. Οι συμμετοχές θα είναι κοντά στις 300, όπως ήταν στα 420. Πρόκειται για προπονητές και αθλητές. Περίπου 600 άτομα θα έρθουν στη βάση μας. Ήδη έχουμε στήσει γραφείο υπηρεσιακό για να οργανώσει τα πάντα και να μην υπάρξει το παραμικρό πρόβλημα. Οι εγκαταστάσεις έχουν όλες τις υποδομές. \r\n\r\nΟ Δήμος Καλλιθέας ετοιμάζει ένας παγκόσμιος χώρος, στον οποίο θα υποδέχεται κάποιους αθλητές από τη Βόρια Ευρώπη και από μακρινές χώρες που θέλουν να προπονηθούν στα νερά μας. Οι μισές εγκαταστάσεις ενοικιαστήκαν είναι στα δικαστήρια και αυτή τη στιγμή δεν υπάρχει κάποια λύση. \r\n\r\nΚάποιοι κοιτώνες από τον Άγιο Κοσμά στεγάστηκαν εδώ. Θέλουμε να βρούμε σπόνσορες. Υπάρχουν άνθρωποι που ενδιαφέρονται και θέλουν να στηρίξουν τις προσπάθειες αυτές, ώστε να υπάρχει το έναυσμα σε εκείνους να προχωρήσουν σε μία τέτοια ενέργεια. \r\n\r\nΠρέπει να στηριχθούμε στον αθλητικό τουρισμό, επειδή κάποιοι βασίστηκαν σε αυτό μόνο για είκοσι μέρες το 2004. Αφού υστερούμε σε βιομηχανίες χρειάζεται να στηρίξουμε την τουριστική βιομηχανία».', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'Δε θα συνεχίσει να αγωνίζεται σε Ολυμπιακούς Αγώνες ο Μπεν Είνσλι. Ο Βρετανός, τέσσερις φόρες «χρυσός» Ολυμπιονίκης της ιστιοπλοΐας, ανακοίνωσε την αποχώρησή του από ότι έχει σχέση με το άθλημα σε Ολυμπιάδες. \r\n\r\nΟ Εϊνσλι είχε προαναγγείλει την απόσυρσή του μετά τη νίκη του στο Γουέιμαουθ το περασμένο καλοκαίρι, ώστε να «ανοίξει» τον δρόμο για τους νέους αθλητές που έπονται. \r\n\r\nΕπιμέλεια: Παναγιώτης Βλαχαδάμης', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, 'Προφυλακιστέοι κρίθηκαν μετά τις απολογίες στον ανακριτή Πατρών, δύο από τους τρεις κατηγορούμενους για την υπόθεση της ληστείας, στο παλαιό Μουσείο της Αρχαίας Ολυμπίας. \r\n\r\nΕιδικότερα προφυλακιστέοι κρίθηκαν ο 41χρονος και ο 50χρονος, ενώ ελεύθερος με περιοριστικούς όρους αφέθηκε ο 36χρονος. \r\n\r\nΣύμφωνα με πληροφορίες που επικαλείται το Αθηναϊκό Πρακτορείο ο 41χρονος κατηγορούμενος ισχυρίστηκε μεταξύ άλλων στην απολογία του, ότι έκανε την κλοπή για να εξοικονομήσει χρήματα, επειδή ήταν σε δύσκολη οικονομική κατάσταση, ενώ αρνήθηκε την πράξη της ληστείας, διότι όπως υποστήριξε, δεν άσκησε καμία σωματική βία, ούτε αφαίρεσε κινητό αντικείμενο από άλλο πρόσωπο. \r\n\r\nΑκόμη ο 41χρονος φέρεται να έχει αποκαλύψει τα στοιχεία ενός αλλοδαπού, τον οποίο υπέδειξε ως συνεργό του. \r\nΌσον αφορά την συμμετοχή των δύο άλλων συλληφθέντων, του 50χρονου και του 36χρονου, ανέφερε ότι η συμμετοχή του πρώτου περιορίζεται στο ότι τον συνόδευσε στην συνάντηση, όπου αποπειράθηκε να πουλήσει το κλεμμένο χρυσό δαχτυλίδι και πρόσθεσε ότι 50χρονος ήρθε μαζί με τον 36χρονο, τον οποίο όπως είπε δεν γνώριζε. \r\n\r\nΕπίσης κατά την διάρκεια της απολογίας του, ο 41χρονος είπε ότι οι δεν είχαν συστήσει μαζί με τους άλλους δύο κατηγορούμενος εγκληματική οργάνωση και συμπλήρωσε ότι αμέσως μετά την σύλληψή του, παρέδωσε χωρίς την άσκηση καμιάς βίας τα αρχαία αντικείμενα, υποδεικνύοντας το σημείο που τα είχαν κρύψει, δηλώνοντας ταυτόχρονα ότι έχει μετανιώσει για την πράξη του. \r\n\r\nΣτην δική του απολογία ο 36χρονος ισχυρίστηκε ότι δεν είχε καμία συμμετοχή στην ληστεία και πρόσθεσε ότι το μόνο που έκανε ήταν να μεταφέρει τον 50χρονο στο σημείο συνάντησης για την αγοραπωλησία του δακτυλιδιού. Ακόμη ανέφερε ότι το μόνο που γνώριζε για την συνάντηση, ήταν πως θα γινόταν μία παράνομη συναλλαγή και τίποτα περισσότερο. Επίσης είπε ότι για την μεταφορά του 50χρονου θα έπαιρνε 400 ευρώ, τα οποία όπως συμπλήρωσε τα είχε ανάγκη, λόγω της δύσκολης οικονομικής κατάστασης που βρίσκεται η οικογένειά του. \r\n', '', 'filtered_html');
