(1, 'node', ' γιατί κάνουν όλοι μια επείγουσα δήλωση στο facebook  με αφορμή τις επικείμενες αλλαγές στο facebook πολλά μέλη του κοινωνικού δικτύου αναρτούν στην σελίδα τους μια δήλωση περί διατήρησης της κυριότητας του περιεχομένου που ανεβάζουν η ανάρτηση αυτή διαδίδεται από φίλο σε φίλο και έτσι δεν είναι διόλου απίθανο να είδατε το χρονολόγιό σας να πλημμυρίζει με δηλώσεις του τύπου i hereby declare συγκεκριμένα η ανάρτηση στην αγγλική γλώσσα αλλά και πολλές αποδόσεις στα ελληνικά γράφει in response to the new facebook guidelines i hereby declare that my copyright is attached to all of my personal details illustrations comics paintings crafts professional photos and videos etc as a result of the berner convention for commercial use of the above my written consent is needed at all times facebook is now an open capital entity all members are recommended to publish a notice like this or if you prefer you may copy and paste this version με λίγα λόγια με αυτή τη δήλωση το μέλος του facebook που την αναρτά επιχειρεί να διασφαλίσει την κυριότητα σε ό τι ανεβάζει στο προφίλ του και απαιτεί να του ζητείται η έγκριση όποτε οτιδήποτε χρησιμοποιείται για εμπορικούς σκοπούς τέλος προτρέπονται άλλα μέλη να κάνουν το ίδιο ή κάτι ανάλογο αντιγράφοντας την δήλωση αυτή στο προφίλ τους με το επιχείρημα ότι το facebook είναι εταιρεία εισηγμένη στο χρηματιστήριο ωστόσο όπως διαπιστώνει ο γνωστός δημοσιογράφος ντέιβιντ πογκ στην εφημερίδα τάιμς της νέας υόρκης και όχι μόνο πρόκειται για ένα από τα λεγόμενα hoax μπορείτε να διαβάσετε σχετικά στο techingr ιστορίες τρόμου ή τι εστί hoax επιπλέον η δήλωση περιέχει κάποια προφανή λάθη όπως συμβαίνει συχνά σε αυτές τις περιπτώσεις πχ γίνεται αναφορά στην ανύπαρκτη συνθήκη berner στην θέση της οποίας μάλλον ο συντάκτης εννοούσε την συνθήκη της βέρνης του 1886 που αφορούσε σε λογοτεχνικά και εικαστικά έργα εκτός όμως από αυτά τα αντεπιχειρήματα το facebook έχει δημόσια διαψεύσει την φήμη στην σελίδα facebook and privacy στο facebook υπάρχει επίσημη διάψευση που αναφέρει πως κυκλοφορεί μια φήμη ότι το facebook κάνει μια αλλαγή που συνδέεται με την κυριότητα των πληροφοριών των χρηστών ή το περιεχόμενο που δημιοσιεύουν σε αυτόν είναι ψευδής οποιοσδήποτε χρησιμοποιεί το facebook κατέχει και ελέγχει το περιεχόμενο και την πληροφορία που αναρτά όπως περιγράφεται στους όρους της υπηρεσίας κάντε κλικ εδώ για να μάθετε περισσότερα  wwwfacebookcom policies  τέλος τα δικαιώματά σας στο facebook αναφέρονται με λεπτομέρεια στην σελίδα https wwwfacebookcom legal terms ref pf εκεί διευκρινίζεται πως το σύνολο του περιεχομένου και των πληροφοριών που δημοσιεύετε στο facebook σάς ανήκει και μπορείτε να ελέγχετε τον τρόπο με τον οποίο κοινοποιείται σε τρίτους μέσω των ρυθμίσεων απορρήτου και εφαρμογών  με αφορμή τις επικείμενες αλλαγές στο facebook πολλά μέλη του κοινωνικού δικτύου αναρτούν στην σελίδα τους μια δήλωση περί διατήρησης της κυριότητας του περιεχομένου που ανεβάζουν η ανάρτηση αυτή διαδίδεται από φίλο σε φίλο και έτσι δεν είναι διόλου απίθανο να είδατε το χρονολόγιό σας να πλημμυρίζει με δηλώσεις του τύπου i hereby declare  ', 0),
(2, 'node', '  εκτελεστή αναζητά η ευρωπαϊκή κεντρική τράπεζα η ευρωπαϊκή κεντρική τράπεζα πρότεινε ο πανίσχυρος ευρωπαίος επίτροπος αρμόδιος για την αντιμονοπωλιακή πολιτική να πάρει ένα νέο ρόλο που θα αφορά στο οριστικό κλείσιμο των αδύναμων τραπεζών που επιβιώνουν από τους πόρους που τους παρέχει η κεντρική τράπεζα όπως μεταδίδει το reuters ελλείψει πανευρωπαϊκού σχεδίου για τα πιστωτικά ιδρύματα ο ρόλος της εκκαθάρισης των αποκαλούμενων τραπεζώνζόμπι πέφτει στη δικαιοδοσία του αλμούνια του ευρωπαίου επίτροπου αρμόδιου για την αντιμονοπωλιακή πολιτική ο οποία ενέκρινε σήμερα την αναδιοργάνωση του ισπανικού τραπεζικού τομέα και επιθυμεί να γίνουν αντίστοιχα βήματα και στις ελληνικές τράπεζες αξιωματούχοι της εκτ εξετάζουν το αν θα μπορούσε να δοθεί στον αλμούνια η δικαιοδοσία σε μόνιμη βάση και θα αφορά τις τράπεζες που είναι πολύ αδύναμες για να επιβιώσουν η ίδρυση μία σχετικής υπηρεσίας θα είναι προς την κατεύθυνση της τραπεζικής ενοποίησης και θα αφορά τράπεζες που κρατούνται ζωντανές με μηχανική υποστήριξη με στόχο φυσικά να αποκατασταθεί η εμπιστοσύνη στον ευρωπαϊκό τραπεζικό τομέα τράπεζα εκτελεστή ευρωπαϊκή ', 0),
(3, 'node', '  δεν υπάρχει παράγκα από το 96  δήλωση η οποία δεν θα ηχήσει καλά στα αυτιά του κόσμου του παναθηναϊκού έκανε ο επί σειρά ετών παράγοντας του τριφυλλιού μάνος μαυροκουκουλάκης δεν υπήρξε καμία παράγκα δεν θέλω να απαντήσω εγώ τα του οίκου μου κρίνω είπε στον novaσπορ fm 946 σε ερώτηση του τάσου νικολογιάννη ο βαρδινογιάννης δεν ασχολήθηκε ποτέ με την διαιτησία συμπλήρωσε ο mr manos ενώ επιτέθηκε με βαριές εκφράσεις στο μέλος της παναθηναϊκής συμμαχίας δ βερβεσό ο κ μαυροκουκουλάκης βγήκε στον αέρα της πρώτης αθλητικής συχνότητας της χώρας για να απαντήσει σε δηλώσεις του μέλους της παναθηναϊκής συμμαχίας κ βερβεσού ο τελευταίος είπε πως υπάρχει παράγκα στο ποδόσφαιρο και πως δεν είναι κάτι περίεργο αφού και παλιότερα επί εποχής βαρδινογιάννη υπήρχε ο παλιός παράγοντας του τριφυλλιού θίχτηκε και βγήκε στους αντώνη καρπετόπουλο και αντώνη πανούτσο να δώσει απαντήσεις διαβάστε όσα είπε στον novaσπορ fm 946 ο μάνος μαυροκουκουλάκης σας παρακαλώ μην υποβαθμίζετε αυτά που δήλωσε ο βερβεσός δεν χρειάζεται να το κάνουμε πασαληψατέρ είναι διακεκριμένος δικηγόρος προσεκτικά να μιλήσουμε λοιπόν σε ότι αφορά εμένα εγώ υπηρέτησα τον σύλλογο για 2022 χρόνια ως αντιπρόεδρος και ως διευθύνων σύμβουλος μετά τον επαγγελματικό αθλητισμό του 79 να ξέρετε πως ο κύριος βαρδής βαρδινογιάννης στα εβδομαδιαία μίτινγκ που κάναμε όταν εμείς φοβόμασταν την διαιτησία μας απαντούσε επί λέξει να κάνετε την καλύτερη ομάδα παιδιά να βάζετε 4 και να σας ακυρώνουν τα 2 δεν αλλάζω ούτε λέξη πάντα έλεγα το ίδιο όσιμ ρότσα γαλάκος ζάετς δανιήλ από εκεί και πέρα στην ολιγόμηνη περίοδο που συνεργάστηκα με τον βγενόπουλο και όταν τον πίεζα να πάρει το πλειοψηφικό πακέτο μου έλεγε μάνο εγώ στο πρωτάθλημα τι προστασία θα έχω για το ευ αγωνίζεσθαι εγώ αυτά ξέρω οπότε λοιπον ο βερβεσος που βγήκε και είπε αυτά τα πράγματα χτες για την εποχή βαρδινογιάννη μπορεί να πάει στο διάολο και ακόμη παραπέρα και να μάθει να διοικεί κι ας μην ξέρει να δένει τα παπούτσια του δεν επιτρέπεται να μιλάει για νεκρ