(4, 'node', '  δεν μπορούμε να αφήσουμε έτσι τον παο  κατηγορηματικός ότι η διοίκηση του οακα θα διεκδικήσει από τον παναθηναϊκό τα χρήματα που οφείλει για την χρήση του γηπέδου εμφανίστηκε ο πέτρος γαλακτόπουλος οι μεγάλες ομάδες δεν πληρώνουν δεν μπορούμε να τους αφήσουμε έτσι δεν κυνηγάμε τον παο αλλά πρέπει να έρθουμε σε διακανονισμό για τα χρήματα που οφείλει τόνισε ο νέος πρόεδρος του οακα στον novaσπορ fm 946 τη λειτουργία μουσείου ελλήνων ολυμπιονικών σπύρος λούης στο ολυμπιακό στάδιο προανήγγειλε ο παλιός πρωταθλητής της πάλης αναλυτικά όσα είπε στην εκπομπή μπαμ και κάτω με τους μπάμπη χριστόγλου και μιχάλη λεάνη η συζήτηση έγινε με αφορμή την επιστολή της διοίκησης του οακα οι αγώνες του παναθηναϊκού να γίνονται το μεσημέρι λόγω ανεξόφλητων οφειλών στη δεη σήμερα δεν κυνηγάμε τον παναθηναϊκό αλλά χρωστάει λεφτά ένα ποσό από πέρυσι και πρέπει να έρθουμε σε διακανονισμό αύριο θα έχουμε ραντεβού με την αεκ η οποία χρωστάει πολύ λιγότερα λεφτά δεν χαρίζουμε λεφτά ανήκουμε στο υπουργείο οικονομικών και στην γενική γραμματεία αθλητισμού θα κυνηγήσουμε την παε την ποδηλατοδρομία τον σεγασ και όποιον άλλο μας χρωστάει το ίδιο κάνει και στο οακα και σε άλλους προμηθευτές ο ένας χρωστάει στον άλλο το προσωπικό παίρνει τα λεφτά του οι ενοικιαστές κάποιοι πληρώνουν κι άλλοι όχι οι μεγάλες ομάδες δεν πληρώνουν το οακα δεν μπορούμε να τους αφήσουμε έτσι με τον νέο νόμο για να μην νομίζουν ότι θα τους χαρίσουμε λεφτά ή θα δώσει τη λύση η πολιτεία ή θα κάνουμε κατασχέσεις ισχύει βεβαίως το ουκ αν λάβεις παρά του μη έχοντος όμως η διαδικασία είναι επιβεβλημένη δεν μπορούμε να αντιταχθούμε στον νέο νόμο για τη δυσκολία του παναθηναϊκού να φανεί συνεπής δεν είναι μόνο ο αθλητισμός είναι και ένα μεγάλο μέρος της κοινωνίας έτσι πήραμε λεφτά από τις τράπεζες δεν μπορούμε να τα δώσουμε έτσι συμβαίνει και στον παναθηναϊκό όταν χρωστάμε εμείς 55 εκατ στη δεη από πού τα χρωστάμε από ό τι είναι να λαμβάνουμε για το πώς σκέφτεται να αξιοποιήσει τις εγκαταστάσεις του οακα εδώ ο χώρος