(7, 'node', ' προφυλακιστέοι δύο από τους τρεις για τη ληστεία στην αρχαία ολυμπία προφυλακιστέοι κρίθηκαν μετά τις απολογίες στον ανακριτή πατρών δύο από τους τρεις κατηγορούμενους για την υπόθεση της ληστείας στο παλαιό μουσείο της αρχαίας ολυμπίας ειδικότερα προφυλακιστέοι κρίθηκαν ο 41χρονος και ο 50χρονος ενώ ελεύθερος με περιοριστικούς όρους αφέθηκε ο 36χρονος σύμφωνα με πληροφορίες που επικαλείται το αθηναϊκό πρακτορείο ο 41χρονος κατηγορούμενος ισχυρίστηκε μεταξύ άλλων στην απολογία του ότι έκανε την κλοπή για να εξοικονομήσει χρήματα επειδή ήταν σε δύσκολη οικονομική κατάσταση ενώ αρνήθηκε την πράξη της ληστείας διότι όπως υποστήριξε δεν άσκησε καμία σωματική βία ούτε αφαίρεσε κινητό αντικείμενο από άλλο πρόσωπο ακόμη ο 41χρονος φέρεται να έχει αποκαλύψει τα στοιχεία ενός αλλοδαπού τον οποίο υπέδειξε ως συνεργό του όσον αφορά την συμμετοχή των δύο άλλων συλληφθέντων του 50χρονου και του 36χρονου ανέφερε ότι η συμμετοχή του πρώτου περιορίζεται στο ότι τον συνόδευσε στην συνάντηση όπου αποπειράθηκε να πουλήσει το κλεμμένο χρυσό δαχτυλίδι και πρόσθεσε ότι 50χρονος ήρθε μαζί με τον 36χρονο τον οποίο όπως είπε δεν γνώριζε επίσης κατά την διάρκεια της απολογίας του ο 41χρονος είπε ότι οι δεν είχαν συστήσει μαζί με τους άλλους δύο κατηγορούμενος εγκληματική οργάνωση και συμπλήρωσε ότι αμέσως μετά την σύλληψή του παρέδωσε χωρίς την άσκηση καμιάς βίας τα αρχαία αντικείμενα υποδεικνύοντας το σημείο που τα είχαν κρύψει δηλώνοντας ταυτόχρονα ότι έχει μετανιώσει για την πράξη του στην δική του απολογία ο 36χρονος ισχυρίστηκε ότι δεν είχε καμία συμμετοχή στην ληστεία και πρόσθεσε ότι το μόνο που έκανε ήταν να μεταφέρει τον 50χρονο στο σημείο συνάντησης για την αγοραπωλησία του δακτυλιδιού ακόμη ανέφερε ότι το μόνο που γνώριζε για την συνάντηση ήταν πως θα γινόταν μία παράνομη συναλλαγή και τίποτα περισσότερο επίσης είπε ότι για την μεταφορά του 50χρονου θα έπαιρνε 400 ευρώ τα οποία όπως συμπλήρωσε τα είχε ανάγκη λόγω της δύσκολης οικονομικής κατάστασης που βρίσκεται η οι